import React from "react";


const PlanetDetail = (props) => {
  if (!props.planet) {
    return <div>Loading...</div>;
  }
  const url = `https://swapi.co/api/planets/?search=${props.planet.id.videoId}`;
  return (
    <div className="planet-detail col-md-8">
      <div className="embed-responsive embed-responsive-16by9">
        <iframe className="embed-responsive-item" src={url} />
      </div>
      <div className="details">
        <div>{props.planet.name}</div>
        <div>{props.planet.climate}</div>
        <div>{props.planet.population}</div>
        <div>{props.planet.diameter}</div>
        <div>{props.planet.surface_water}</div>
      </div>
    </div>
  )
};

export default PlanetDetail;
